function ShowModal(player, playerSayCiudad)
local text = {}
text[1] = "--- " ..playerSayCiudad .. " --- \n"


for i = 0, #destination do
if destination[i].city:lower() == playerSayCiudad:lower() then
text[#text+1] = destination[i].clave ..  " " .. destination[i].dificult .. " - " .. destination[i].description .."\n"
end
end

player:showTextDialog(1949, table.concat(text), false)
return true
end